import "../index.css"
import {useEffect,useState} from "react"
function refresh(){
    alert('Hello')
}
/*
onClick後 會去後端拉資料 顯示在前端
*/
/*
next : json Server資料 放在表單
*/ 
const List = ({data})=>{
    
    console.log(data.data)
    
    return <div className="list">
            {data.data.map((Nation,Temp)=>{
                return <div>{Nation}</div>
            })}
            
    </div>     
}

export default List;
